export const Home = () => {

    return(
        <section className={styles["home"]}>

            <div className={styles["textContent"]}>
                <h1 className={styles["homeTitle"]}>Welcome to ChefPinko!</h1>
                <p className={styles["homeParagraph"]}>We’re here to help you go from curious cook to confident in the kitchen.</p>
            </div>

            <div className={styles["homeContainer"]}></div>
        </section>
    );
}

